import React from 'react';
import {useEffect} from 'react';
import {useState} from 'react';
import axios from 'axios';
import './nba.css'

const Nba = () => {

    const [data, setData] = useState([]);

    const loadData = async () => {
        const response = await axios.get("http://localhost:3001/api/get/nbateams")
        setData(response.data);
    };

    useEffect (() => {
        loadData();
    }, []);

    return (
        
            <table className="dataTable">


                <tbody>
                    {data.map((item, index) => {
                        return (
                            <tr key={item.index}>
                                <th scope="row">{index+1}</th>
                                <td>{item.teamName}</td>
                                <td>{item.points}</td>
                                <td>{item.gamesPlayed}</td>
                                <td>{item.minutesPlayed}</td>
                                <td>{item.FGM}</td>
                                <td>{item.FGA}</td>
                                <td>{Math.round(item.FG_PCT*100) + "%"}</td>
                                <td>{item.ThreePM}</td>
                                <td>{item.ThreePA}</td>
                                <td>{Math.round(item.Three_PCT*100) + "%"}</td>
                                <td>{item.TwoPM}</td>
                                <td>{item.TwoPA}</td>
                                <td>{Math.round(item.Two_PCT*100) + "%"}</td>
                                <td>{item.FTM}</td>
                                <td>{item.FTA}</td>
                                <td>{Math.round(item.FT_PCT*100) + "%"}</td>
                                <td>{item.oRebounds}</td>
                                <td>{item.dRebounds}</td>
                                <td>{item.tRebounds}</td>
                                <td>{item.assists}</td>
                                <td>{item.steals}</td>
                                <td>{item.blocks}</td>
                                <td>{item.turnover}</td>
                                <td>{item.foulsCommitted}</td>
                            </tr>
                        )
                    })}
                </tbody>
            </table>

    )
}

export default Nba;
